import { Button, Box, TextField } from "@mui/material";

export default function TaskForm(): JSX.Element {
    return (
        <Box sx={{position: "fixed", top: "25%", left: "25%", width: 1/2, height: "50%", border: 2}}>
            <TextField sx={{position: "relative", top: 10, left: "25%", width: "50%", marginRight: "50%", marginBottom: "15px"}}>
                Name
            </TextField>
            <TextField sx={{position: "relative", left: "25%", width: "50%", marginRight: "50%", marginBottom: "5px"}}>
                Description
            </TextField>
            <TextField sx={{position: "relative", left: "25%", width: "50%", marginRight: "50%", marginBottom: "5px"}}>
                Due time
            </TextField>
            <Button sx={{position: "relative", left: "25%", top: "90%", width: "50%", marginRight: "50%", border: 1}}>
                Submit
            </Button>
        </Box>
    );
}
